import React from 'react';
import github from '../../assets/img/github.png'
import linkedin from '../../assets'

function Footer() {
    return (
        <div className="footerlinks">
            <a href="https://github.com/becketbowes">
                <img src="./assets/img/github.png" alt="find me on github" />
            </a>
            <a href="https://www.linkedin.com/in/codeclast/" target="blank">
                <img src="./assets/img/linkedin.png" alt="find me on linkedin" />
            </a>
            <a href="https://twitter.com/becketbowes/status/395971206731419648?s=20&t=L0pTsZ2aTMmJ0kH5C9mXmg">
                <img src="./assets/img/twitter.png" alt="find me on twitter" />
            </a>
        </div>
    )
};

export default Footer;
